import { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function Square({ value}) {
  const [color, setColor] = useState("#ffffff");
  function toggleSquare() {
    if (color == "#ffffff") {
      setColor("#800000");
    } else if (color == "#800000") {
      setColor("#ffffff");
    }
  }
  let chopanga = null;
  if (color == "#ffffff") {
    chopanga = <button className="square" onClick={toggleSquare}>{value}</button>;
  } else if (color == "#800000") {
    chopanga = <button className="redsquare" onClick={toggleSquare}>{value}</button>;
  }

  return chopanga;
}

function Board({curMeal}) {
  const blevins = curMeal[0].items;
  const listItems = blevins.map(food =>
    <div className="board-row" key={food}>
      <Square value ={getFoodWithId(food)}/>
    </div>
  );
  return <>{listItems}</>;
}

export default function Game() {
  const bf = breakfast();
  const lh = lunch();
  const dn = dinner();
  return (
    <div className="game">
      <div >
        <Board curMeal={bf} />
      </div>
      <div >
        <Board curMeal={lh} />
      </div>
      <div>
        <Board curMeal={dn} /> 
        </div>
    </div>
  );
}

function getFoodWithId(foodId) {
  let result = parseInt(foodId);
  return menuItems()[result].label;
}



